import React, { useState, useEffect, useCallback } from "react";
import "./animations.css";

interface Tile {
  id: number;
  content: string;
  isFlipped: boolean;
  isMatched: boolean;
  animate: boolean;
}

const MemoryTileGame = () => {
  const [tiles, setTiles] = useState<Tile[]>([]);
  const [flippedTiles, setFlippedTiles] = useState<number[]>([]);
  const [moves, setMoves] = useState(0);
  const [matches, setMatches] = useState(0);
  const [gameOver, setGameOver] = useState(false);
  const [customImages, setCustomImages] = useState<string[]>([]);
  const [imageUploads, setImageUploads] = useState<File[]>([]);
  const [showConfetti, setShowConfetti] = useState(false);
  const [showSplash, setShowSplash] = useState(true);
  const [playerName, setPlayerName] = useState("");

  const audioMatch = new Audio("./bong.mp3");
  const audioFlip = new Audio("https://www.myinstants.com/media/sounds/flip.mp3");
  const audioWin = new Audio("./win.mp3");

  const generateAvatar = useCallback(() => {
    const seed = Math.random().toString(36).substring(7);
    return `https://api.dicebear.com/9.x/fun-emoji/svg?seed=${seed}`;
  }, []);

  const generateDefaultImages = useCallback(() => {
    const numPairs = 6;
    const avatars = [];
    for (let i = 0; i < numPairs; i++) {
      avatars.push(generateAvatar());
      avatars.push(generateAvatar());
    }
    return avatars;
  }, [generateAvatar]);

  const initializeGame = useCallback(() => {
    const numPairs = 6;
    let imagePool: string[];

    if (customImages.length >= numPairs) {
      imagePool = customImages.slice(0, numPairs);
    } else if (customImages.length > 0) {
      const remaining = numPairs - customImages.length;
      const generated = Array(remaining)
        .fill(null)
        .map(() => generateAvatar());
      imagePool = [...customImages, ...generated];
    } else {
      imagePool = generateDefaultImages();
    }

    const pairs = imagePool.slice(0, numPairs);
    const duplicatedPairs = [...pairs, ...pairs];
    const shuffled = duplicatedPairs.sort(() => Math.random() - 0.5);

    const initialTiles: Tile[] = shuffled.map((content, index) => ({
      id: index,
      content,
      isFlipped: false,
      isMatched: false,
      animate: false,
    }));

    setTiles(initialTiles);
    setFlippedTiles([]);
    setMoves(0);
    setMatches(0);
    setGameOver(false);
    setShowConfetti(false);
  }, [customImages, generateAvatar, generateDefaultImages]);

  useEffect(() => {
    if (!showSplash) initializeGame();
  }, [initializeGame, showSplash]);

  useEffect(() => {
    if (matches === 6) {
      setGameOver(true);
      setShowConfetti(true);
      audioWin.play();
    }
  }, [matches]);

  const handleTileClick = (id: number) => {
    const clickedTile = tiles.find((tile) => tile.id === id);
    if (!clickedTile || clickedTile.isFlipped || clickedTile.isMatched || flippedTiles.length === 2) return;

    const newTiles = tiles.map((tile) =>
      tile.id === id ? { ...tile, isFlipped: true, animate: true } : tile
    );
    setTiles(newTiles);
    setFlippedTiles((prev) => [...prev, id]);
    audioFlip.play();
  };

  useEffect(() => {
    if (flippedTiles.length === 2) {
      const [firstId, secondId] = flippedTiles;
      const firstTile = tiles.find((tile) => tile.id === firstId);
      const secondTile = tiles.find((tile) => tile.id === secondId);

      if (firstTile && secondTile) {
        if (firstTile.content === secondTile.content) {
          const updatedTiles = tiles.map((tile) =>
            tile.id === firstId || tile.id === secondId
              ? { ...tile, isMatched: true }
              : tile
          );
          setTiles(updatedTiles);
          setMatches((prev) => prev + 1);
          audioMatch.play();
        } else {
          setTimeout(() => {
            const updatedTiles = tiles.map((tile) =>
              tile.id === firstId || tile.id === secondId
                ? { ...tile, isFlipped: false }
                : tile
            );
            setTiles(updatedTiles);
          }, 1000);
        }
        setMoves((prev) => prev + 1);
        setTimeout(() => setFlippedTiles([]), 1000);
      }
    }
  }, [flippedTiles, tiles]);

  const handleImageUpload = (e: React.ChangeEvent<HTMLInputElement>) => {
    const files = Array.from(e.target.files || []);
    setImageUploads(files);

    const readers = files.map(
      (file) =>
        new Promise<string>((resolve) => {
          const reader = new FileReader();
          reader.onload = () => resolve(reader.result as string);
          reader.readAsDataURL(file);
        })
    );

    Promise.all(readers).then((base64Images) => {
      setCustomImages(base64Images);
    });
  };

  const handleStartGame = () => {
    setShowSplash(false);
  };

  const handleRestart = () => {
    initializeGame();
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-tr from-pink-100 via-yellow-100 to-green-100 puzzle-font">
      {showSplash ? (
        <div className="animate-fade-in text-center">
          <h1 className="text-4xl mb-4 font-bold">Memory Tile Game</h1>
          <input
            type="text"
            placeholder="Enter your name"
            value={playerName}
            onChange={(e) => setPlayerName(e.target.value)}
            className="mb-4 px-4 py-2 rounded border"
          />
          <input
            type="file"
            multiple
            accept="image/*"
            onChange={handleImageUpload}
            className="mb-4"
          />
          <button onClick={handleStartGame} className="bubbly-button">
            Start Game
          </button>
        </div>
      ) : (
        <div className="animate-fade-in text-center w-full max-w-4xl">
          <h2 className="text-2xl mb-2">Player: {playerName || "Anonymous"}</h2>
          <p className="mb-4">Moves: {moves} | Matches: {matches}</p>
          <div className="grid grid-cols-3 gap-4">
            {tiles.map((tile) => (
              <div
                key={tile.id}
                className={`tile-container w-32 h-32 cursor-pointer`}
                onClick={() => handleTileClick(tile.id)}
              >
                <div className={`tile-inner ${tile.isFlipped ? "tile-flipped" : ""}`}>
                  <div className="tile-face tile-front bg-white shadow-md">
                    <span className="text-xl">?</span>
                  </div>
                  <div className="tile-face tile-back bg-white flex items-center justify-center">
                    <img src={tile.content} alt="tile" className="w-full h-full object-cover" />
                  </div>
                </div>
              </div>
            ))}
          </div>

          {gameOver && (
            <div className="mt-6 text-center">
              <h2 className="text-3xl font-bold mb-4 glow">ðŸŽ‰ You Win, {playerName || "Player"}! ðŸŽ‰</h2>
              <button onClick={handleRestart} className="bubbly-button">
                Play Again
              </button>
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default MemoryTileGame;
